  true,\n\t\"url\": null,\n\t\"notes\": \"IDEA Part B Section 618 Table 7 Dispute
  Resolution, School Year 2011-12 (IDEA Part B Table 7 SY 2011-12), is a study that
  is part of the IDEA Part B program; program data is available since 2006 at <http://tadnet.public.tadnet.org/pages/712>.
  IDEA Part B Table 7 SY 2011-12 is a universe cross-sectional report that collected
  counts of dispute resolution actions under IDEA Part B. State education agencies
  (SEAs) must submit data required by section 618 of the IDEA on the form provided
  by the Secretary by electronic submission. Key statistics produced from IDEA Part
  B Table 7 SY 2011-12 provide filed complaints, hearings, mediations, and settlement
  agreements under IDEA Part B, and how IDEA funds are used.\",\n\t\"license_title\":
